import React from 'react';

const About = () => {
  return (
    <section className="about" id="about">
      <h2>About Me</h2>
      <div className="about-content">
        <div className="about-text">
          <p>
            I'm a passionate developer with experience in building web applications
            using modern technologies. I love solving problems and creating
            intuitive, dynamic user experiences.
          </p>
          <p>
            When I'm not coding, you can find me hiking, reading, or exploring
            new coffee shops.
          </p>
        </div>
        <div className="about-image">
          <img src="public\assets\profile.jpg" alt="Profile.jpg" />
        </div>
      </div>
    </section>
  );
};

export default About;
